 .gamification-tip-infobox-content .gamification-tip-infobox-content-controls a.button:hover{color:#f8f8f8;background:#5f5f5f;border-color:#2c2c2c;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}.gamification-tip-infobox .gamification-tip-infobox-content .gamification-tip-infobox-content-controls a.button:active{color:white;background:#2c2c2c;border-color:black;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}.gamification-tip-infobox a.infobox-close{display:inline-block;width:14px;height:14px;position:absolute;top:20px;right:20px;text-indent:-9999px;background:url("https://gamification.prestashop.com/images/interface/gamification-infobox-close.png") no-repeat}\n</style>\n<hr class="clear"/>\n<div id="advice-16">\n<div class="gamification-tip">\n	<div class="gamification-tip-title">Advice</div>\n	<span class="gamification-tip-cta"><a class="gamification_fancybox"  id="589" href="#advice_content_589">Read</a><a class="gamification_close" style="display:none"  id="589" href="#advice_content_589">Close</a></span>\n\n	<div class="gamification-tip-description-container">\n		<span class="gamification-tip-description">\n			A 5% lift in retention can increase your profits by 85%. Start increasing retention now!		</span>\n	</div>\n	<div class="hide">\n		<div id="advice_content_589" class="gamification-tip-infobox">\n			<div class="gamification-tip-infobox-title">\n				<span class="gamification-tip-infobox-title-prefix">Advice</span>\n				LoyaltyLion			</div>\n			<div class="gamification-tip-infobox-content">\n				<div class="gamification-tip-infobox-content-image">\n					<img src="https://gamification.prestashop.com/api/getAdviceImg/589.png" alt="logo" style="max-width: 85%">\n				</div>\n				<div class="gamification-tip-infobox-content-description">\n					<div style="text-align: justify;"><span style="font-size: 10pt; font-family: &#039;times new roman&#039;, times;">Add a loyalty program to your store in minutes and increase customer loyalty, profitability and sales. </span></div>\r\n<div>\r\n<ul style="color: #222222; font-family: arial, sans-serif; font-size: 12.8000001907349px;">\r\n<li style="margin-left: 15px; text-align: justify;"><span style="font-size: 10pt; font-family: &#039;times new roman&#039;, times;">Increase loyalty by rewarding purchases, signups, reviews, referrals and visits</span></li>\r\n<li style="margin-left: 15px; text-align: justify;"><span style="font-family: &#039;times new roman&#039;, times;"><span style="font-size: 10pt;">Acquire new customers using the "R</span><span style="font-size: 10pt;">efer a friend" feature</span></span></li>\r\n<li style="margin-left: 15px; text-align: justify;"><span style="font-size: 10pt; font-family: &#039;times new roman&#039;, times;">Learn who your loyal customers are and retain them</span></li>\r\n<li style="margin-left: 15px; text-align: justify;"><span style="font-size: 10pt; font-family: &#039;times new roman&#039;, times;">Differentiate your store from competitors </span></li>\r\n<li style="margin-left: 15px; text-align: justify;"><span style="font-family: &#039;times new roman&#039;, times;"><span style="font-size: 10pt;">Fully </span>customizable<span style="font-size: 10pt;"> - name your program and change the text and colours to match your brand</span></span></li>\r\n</ul>\r\n<div class="yj6qo ajU" style="cursor: pointer; outline: none; padding: 10px 0px; width: 22px; color: #222222; font-family: arial, sans-serif; font-size: 12.8000001907349px;"> </div>\r\n</div>					<div class="gamification-tip-infobox-content-controls right">\n						<a href="javascript:$.fancybox.close();" class="button">Close</a>\n						<a href="{link}AdminModules{/link}&install=loyaltylion&module_name=loyaltylion" class="button success">Install Module</a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(''.gamification_fancybox'').bind(''click'', function () {\n			id_advice = 589;\n			popin_url = ''https://gamification.prestashop.com/get_advice_link.php?id_advice=''+id_advice+''&url='';\n			url = window.location.origin+window.location.pathname.replace(''index.php'', '''')+$(''.gamification-tip-infobox-content-controls a.success'').attr(''href'');\n			$(''.gamification-tip-infobox-content-controls a.success'').attr(''href'', popin_url+encodeURIComponent(url));\n			\n			$(''.gamification-tip-infobox'').after(''<img style="display:none" src="https://gamification.prestashop.com/api/getAdvicePopinImg/''+id_advice+''.png" />'');\n			\n		});\n	});\n</script></div>'),
