(875, 1, '<div id="wrap_id_advice_667" >\n		<section id="0_securityupdate" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Tips of the day</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-securityupdate.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/667.png"/>\n				<p><b>A PrestaShop security update is available</b></p>\n				<p>Make sure you update your store to benefit from our latest security patch!</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=667&url=https%3A%2F%2Fwww.prestashop.com%2Fblog%2Fen%2Fprestashop-security-release">Read all about it</a>\n				</span>\n			</div>\n		</section>\n			<script>\n			$(document).ready( function () {\n				$(''#''+rand(0)+''_securityupdate'').show();\n			});\n\n			function rand(nbr){\n			   return Math.floor(Math.random()*(nbr+1));\n			}\n			</script>\n			</div>');
